import React from 'react';
import { AreaChart, Area, CartesianGrid, XAxis, YAxis } from 'recharts';
import coqSummitData from '../data/coqSummitData.json';

// const data = [{ name: 'Page A', uv: 400, pv: 2400, amt: 2400 }, { name: 'Page B', uv: 200, pv: 2500, amt: 2800 }, { name: 'Page C', uv: 300, pv: 2100, amt: 1900 }, { name: 'Page D', uv: 400, pv: 2400, amt: 2400 },];
const data = coqSummitData;
export const Chart = () => {
  return (
    <AreaChart width={1400} height={700} data={data}
      margin={{ top: 10, right: 30, left: 0, bottom: 0 }}>
      <defs>
        <linearGradient id="colorUv" x1="0" y1="0" x2="0" y2="1">
          <stop offset="5%" stopColor="#8884d8" stopOpacity={0.8} />
          <stop offset="95%" stopColor="#8884d8" stopOpacity={0} />
        </linearGradient>
        <linearGradient id="colorPv" x1="0" y1="0" x2="0" y2="1">
          <stop offset="5%" stopColor="#82ca9d" stopOpacity={0.8} />
          <stop offset="95%" stopColor="#82ca9d" stopOpacity={0} />
        </linearGradient>
      </defs>
      <XAxis dataKey="date" minTickGap={50} />
      <YAxis />
      <CartesianGrid strokeDasharray="3 3" />
      <Area type="monotone" dataKey="snowpack" stroke="#8884d8" fillOpacity={1} fill="url(#colorUv)" />
      {/* <Area type="monotone" dataKey="temp" stroke="#82ca9d" fillOpacity={1} fill="url(#colorPv)" /> */}
    </AreaChart>
  );
};
